import React from "react";

export default function TableOffersHeader() {
  return (
    <thead>
      <tr>
        <th>Вид Имот</th>
        <th>Състояние</th>
        <th>Вид Строителство</th>
        <th>Номер на оферта</th>
        <th>Квартал</th>
        <th>Площ</th>
        <th>Цена</th>
        <th>Адрес</th>
        <th>Етаж</th>
        <th>Още</th>
      </tr>
    </thead>
  );
}
